package main;

import mp.bridgeSceneObject.*;
import javax.swing.Icon;
import javax.swing.ImageIcon;
import mp.bridgeSceneFigures.*;

import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.misc.ThreadSupport;
import tags301.Comp301Tags;
import util.annotations.Tags;

@Tags(Comp301Tags.GREETING_MAIN)
@StructurePattern(StructurePatternNames.BEAN_PATTERN)
public class AnAssignment1 implements Assignment1 {

	static final int SHORT_SLEEP=1000, MEDIUM_SLEEP=3000, LONG_SLEEP=5000; 

	@Override
	public void animateLine() {



		int totalMoves = 20; 

		Line myLine = new ALine();
		OEFrame anOEFrame = ObjectEditor.edit(myLine);
    	anOEFrame.showTreePanel();

    	for (int i=0; i<totalMoves; i++) {
    		myLine.rotate((int) (10* Math.random()));
    		anOEFrame.refresh(); 
    		ThreadSupport.sleep(SHORT_SLEEP);
    		myLine.setX(100 + 10*i);
    		anOEFrame.refresh();
    		ThreadSupport.sleep(SHORT_SLEEP);
    	}
	}

	@Override
	public void demonstrateBridgeScene() {


		BridgeScene myScene = new ABridgeScene();

		OEFrame anOEFrame = ObjectEditor.edit(myScene); 
		anOEFrame.showTreePanel();

		ThreadSupport.sleep(5000);

		myScene.getArthur().setChatBoxText("Good Day!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getArthur().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGuard().setChatBoxText("Who goes there!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGuard().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getLancelot().setChatBoxText("Lancelot is Here!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getLancelot().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGalahad().setChatBoxText("It is I, Galahad");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGalahad().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getRobin().setChatBoxText("This should be easy");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getRobin().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGuard().scale(2);
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGuard().setChatBoxText("I ASKED WHO GOES THERE!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);

		myScene.getRobin().setChatBoxText("Okay, so maybe this will be a bit harder than expected");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getRobin().setChatBoxText("");

		for (int i=0; i<18; i++) {
			myScene.getRobin().move(myScene.getRobin().getSpine().getX() - (2*i), myScene.getRobin().getSpine().getY());
			myScene.getRobin().getArms().getLeftLine().rotate(-4);
			myScene.getRobin().getLegs().getLeftLine().rotate(-4);
			myScene.getRobin().getArms().getRightLine().rotate(4);
			myScene.getRobin().getLegs().getRightLine().rotate(4);
			anOEFrame.refresh();
			ThreadSupport.sleep(100);
			myScene.getRobin().getLegs().getLeftLine().rotate(4);
			myScene.getRobin().getArms().getLeftLine().rotate(4);
			myScene.getRobin().getArms().getRightLine().rotate(-4);
			myScene.getRobin().getLegs().getRightLine().rotate(-4);
			anOEFrame.refresh();
			ThreadSupport.sleep(100); 
		}

		myScene.getGuard().scale(0.5);
		anOEFrame.refresh();

}


	public static void main(String[] args) { 
		Assignment1 myAssignment = new AnAssignment1(); 
		myAssignment.animateLine();
		myAssignment.demonstrateBridgeScene();
		ThreadSupport.sleep(SHORT_SLEEP);

	}


}

