package mp.bridgeSceneFigures;

import mp.bridgeSceneObject.Line;
import tags301.Comp301Tags;
import util.annotations.Tags;

@Tags(Comp301Tags.ANGLE)
public interface Angle {


	public void move(int xVal, int yVal);  

	public Line getLeftLine(); 
	public Line getRightLine(); 

	public void setPos(int x, int y);

	void scale(double val);
}

package mp.bridgeSceneFigures;
import mp.bridgeSceneObject.ALine;
import tags301.Comp301Tags; 
import mp.bridgeSceneObject.Line;
import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.annotations.Tags; 


@StructurePattern(StructurePatternNames.BEAN_PATTERN)

@Tags(Comp301Tags.ANGLE)
public class AngleShape implements Angle {

	static final double INIT_RADIUS = 50.0, INIT_LANGLE = 3*((Math.PI)/4), INIT_RANGLE= Math.PI/4; 

	protected Line leftLine, rightLine;

	public AngleShape() {
		leftLine =  new ALine(INIT_RADIUS, INIT_LANGLE);
		rightLine = new ALine(INIT_RADIUS, INIT_RANGLE);
	}

	@Override
	public void scale(double val) {
		this.leftLine.setRadius(val * leftLine.getRadius());
		this.rightLine.setRadius(val * rightLine.getRadius());
	}

	@Override
	public void move(int xVal, int yVal) { 
		setPos(this.leftLine.getX() + xVal, this.rightLine.getY() + yVal); 
		} 
	@Override
	public Line getLeftLine() { return this.leftLine; }
	@Override
	public Line getRightLine() { return this.rightLine; }
	@Override
	public void setPos(int x, int y) { 
		this.leftLine.setX(x); 
		this.leftLine.setY(y); 
		this.rightLine.setX(x); 
		this.rightLine.setY(y);
	}

}

package mp.bridgeSceneFigures;

import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import mp.bridgeSceneObject.AHead;
import mp.bridgeSceneObject.ALine;
import mp.bridgeSceneObject.AStringShape;
import mp.bridgeSceneObject.Head;
import mp.bridgeSceneObject.Line;
import mp.bridgeSceneObject.StringShape;
import tags301.Comp301Tags;
import util.annotations.EditablePropertyNames;
import util.annotations.PropertyNames;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.annotations.Tags;

@StructurePattern(StructurePatternNames.BEAN_PATTERN)
@PropertyNames({
	"Spine",
	"Arms",
	"Legs",
	"Head",
	"StringShape",
	"ChatBoxText",
})
@EditablePropertyNames({
	"ChatBoxText", 
})
@Tags(Comp301Tags.AVATAR)
public class Body implements Avatar {

	static final int INIT_X=200, INIT_Y=200; 
	static final double SPINE_POS = -(Math.PI/2), INIT_SPINE_LEN=70, NECK_LEN=10; 
	static final String INIT_STRING = "images/galahad.jpg"; 

	protected int x=INIT_X, y=INIT_Y; 
	protected double spineLength = INIT_SPINE_LEN; 

	protected Head head; 
	protected Line spine; 
	protected Angle legs; 
	protected Angle arms; 
	protected StringShape chatBox; 

	public Body(Head head) {
		this.legs = new AngleShape();
		this.arms = new AngleShape();
		this.head = head;  
		this.spine = new ALine(INIT_SPINE_LEN, SPINE_POS);
		this.chatBox = new AStringShape(); 

		constructBody(); 
	}

	public Body(Head head, int xVal, int yVal) {

		this.x = xVal; 
		this.y= yVal; 

		this.legs = new AngleShape();
		this.arms = new AngleShape();
		this.head = head;  
		this.spine = new ALine(INIT_SPINE_LEN, SPINE_POS); 
		this.chatBox = new AStringShape(); 

		constructBody(); 
	}

	@Override 
	public void constructBody() { 

		this.head.setX(toHeadX());
		this.head.setY(toHeadY());

		this.spine.setX(x);
		this.spine.setY(y);
		this.spine.setRadius(this.spineLength);

		this.arms.setPos(x, toArmsY());

		this.legs.setPos(x, y);

		this.chatBox.setX(toChatBoxX());
		this.chatBox.setY(toChatBoxY());
	}

	int toHeadX() { return this.x - (this.head.getWidth() / 2); }
	int toHeadY() { return (int) (this.y - spineLength - head.getHeight()); } 
	int toArmsY() { return (int) (this.y - spineLength + NECK_LEN); }
	int toChatBoxX() { return this.x + (head.getWidth()/2); }
	int toChatBoxY() { return (int) (this.y - spineLength - head.getHeight()); } 

	@Override 
	public void move(int xVal, int yVal) {
		this.x = this.x + xVal; 
		this.y = this.y + yVal; 
		constructBody(); 
	}

	@Override
	public void scale(double val) {
		((AngleShape) this.arms).scale(val);
		((AngleShape) this.legs).scale(val);
		this.spine.setRadius(spineLength * val);
		this.head.setWidth((int) (val * this.head.getWidth()));
		this.head.setHeight(((int) (val * this.head.getHeight())));
		constructBody(); 
	}


	@Override
	public Head getHead() { return this.head; }
	@Override
	public StringShape getStringShape() { return this.chatBox; }
	@Override
	public Line getSpine() { return this.spine; }
	@Override
	public Angle getArms() { return this.arms; } 
	@Override
	public Angle getLegs() { return this.legs;}
	@Override
	public void setChatBoxText(String val) { this.chatBox.setText(val); }



	public static void main(String[] args) {
		Avatar body = new Body( new AHead("images/galahad.jpg"), 200, 200); 
		OEFrame anOEFrame = ObjectEditor.edit((body)); 
		anOEFrame.showTreePanel();
		System.out.println(body.getArms().getLeftLine().getX());
		System.out.println(body.getArms().getLeftLine().getY());

	}
}

