	"ChatBoxText",
})
@EditablePropertyNames({
	"ChatBoxText", 
})
@Tags(Comp301Tags.AVATAR)
public class Body implements Avatar {

	static final int INIT_X=200, INIT_Y=200; 
	static final double SPINE_POS = -(Math.PI/2), INIT_SPINE_LEN=70, NECK_LEN=10; 
	static final String INIT_STRING = "images/galahad.jpg"; 

	protected int x=INIT_X, y=INIT_Y; 
	protected double spineLength = INIT_SPINE_LEN; 

	protected Head head; 
	protected Line spine; 
	protected Angle legs; 
	protected Angle arms; 
	protected StringShape chatBox; 

	public Body(Head head) {
		this.legs = new AngleShape();
		this.arms = new AngleShape();
		this.head = head;  
		this.spine = new ALine(INIT_SPINE_LEN, SPINE_POS);
		this.chatBox = new AStringShape(); 

		constructBody(); 
	}

	public Body(Head head, int xVal, int yVal) {

		this.x = xVal; 
		this.y= yVal; 

		this.legs = new AngleShape();
		this.arms = new AngleShape();
		this.head = head;  
		this.spine = new ALine(INIT_SPINE_LEN, SPINE_POS); 
		this.chatBox = new AStringShape(); 

		constructBody(); 
	}

	@Override 
	public void constructBody() { 

		this.head.setX(toHeadX());
		this.head.setY(toHeadY());

		this.spine.setX(x);
		this.spine.setY(y);
		this.spine.setRadius(this.spineLength);

		this.arms.setPos(x, toArmsY());

		this.legs.setPos(x, y);

		this.chatBox.setX(toChatBoxX());
		this.chatBox.setY(toChatBoxY());
	}

	int toHeadX() { return this.x - (this.head.getWidth() / 2); }
	int toHeadY() { return (int) (this.y - spineLength - head.getHeight()); } 
	int toArmsY() { return (int) (this.y - spineLength + NECK_LEN); }
	int toChatBoxX() { return this.x + (head.getWidth()/2); }
	int toChatBoxY() { return (int) (this.y - spineLength - head.getHeight()); } 

	@Override 
	public void move(int xVal, int yVal) {
		this.x = this.x + xVal; 
		this.y = this.y + yVal; 
		constructBody(); 
	}

	@Override
	public void scale(double val) {
		((AngleShape) this.arms).scale(val);
		((AngleShape) this.legs).scale(val);
		this.spineLength *= val;  
		this.head.setWidth((int) (val * this.head.getWidth()));
		this.head.setHeight(((int) (val * this.head.getHeight())));
		constructBody(); 
	}


	@Override
	public Head getHead() { return this.head; }
	@Override
	public StringShape getStringShape() { return this.chatBox; }
	@Override
	public Line getSpine() { return this.spine; }
	@Override
	public Angle getArms() { return this.arms; } 
	@Override
	public Angle getLegs() { return this.legs;}
	@Override
	public void setChatBoxText(String val) { this.chatBox.setText(val); }



	public static void main(String[] args) {
		Avatar body = new Body( new AHead("images/galahad.jpg"), 200, 200); 
		OEFrame anOEFrame = ObjectEditor.edit((body)); 
		anOEFrame.showTreePanel();
		System.out.println(body.getArms().getLeftLine().getX());
		System.out.println(body.getArms().getLeftLine().getY());

	}
}

package main;

import mp.bridgeSceneObject.*;
import javax.swing.Icon;
import javax.swing.ImageIcon;
import mp.bridgeSceneFigures.*;

import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.misc.ThreadSupport;
import tags301.Comp301Tags;
import util.annotations.Tags;

@Tags(Comp301Tags.GREETING_MAIN)
@StructurePattern(StructurePatternNames.BEAN_PATTERN)
public class AnAssignment1 implements Assignment1 {

	static final int QUICK_SLEEP=100, SHORT_SLEEP=1000, MEDIUM_SLEEP=3000, LONG_SLEEP=5000; 
	static final int RUN_X=-10, ROTATE_LEFT=100, ROTATE_RIGHT=100; 

	@Override
	public void animateLine() {



		int totalMoves = 20; 

		Line myLine = new ALine();
		OEFrame anOEFrame = ObjectEditor.edit(myLine);
    	anOEFrame.showTreePanel();

    	for (int i=0; i<totalMoves; i++) {
    		myLine.rotate((int) (10* Math.random()));
    		anOEFrame.refresh(); 
    		ThreadSupport.sleep(SHORT_SLEEP);
    		myLine.setX(100 + 10*i);
    		anOEFrame.refresh();
    		ThreadSupport.sleep(SHORT_SLEEP);
    	}
	}

	@Override
	public void demonstrateBridgeScene() {


		BridgeScene myScene = new ABridgeScene();

		OEFrame anOEFrame = ObjectEditor.edit(myScene); 
		anOEFrame.showTreePanel();

		ThreadSupport.sleep(SHORT_SLEEP);

		myScene.getArthur().setChatBoxText("Good Day!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getArthur().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGuard().setChatBoxText("Who goes there!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGuard().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getLancelot().setChatBoxText("Lancelot is Here!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getLancelot().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGalahad().setChatBoxText("It is I, Galahad");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGalahad().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getRobin().setChatBoxText("This should be easy");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getRobin().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGuard().scale(2);
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGuard().setChatBoxText("I ASKED WHO GOES THERE!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);

		myScene.getRobin().setChatBoxText("Okay, so maybe this will be a bit harder than expected");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getRobin().setChatBoxText("");

		for (int i=0; i<18; i++) {
			myScene.getRobin().move(RUN_X, 0); 
			myScene.getRobin().getArms().getLeftLine().rotate(ROTATE_LEFT);
			myScene.getRobin().getLegs().getLeftLine().rotate(ROTATE_LEFT);
			myScene.getRobin().getArms().getRightLine().rotate(ROTATE_RIGHT);
			myScene.getRobin().getLegs().getRightLine().rotate(ROTATE_RIGHT);
			anOEFrame.refresh();
			ThreadSupport.sleep(QUICK_SLEEP);
			myScene.getRobin().getLegs().getLeftLine().rotate(ROTATE_RIGHT);
			myScene.getRobin().getArms().getLeftLine().rotate(ROTATE_RIGHT);
			myScene.getRobin().getArms().getRightLine().rotate(ROTATE_LEFT);
			myScene.getRobin().getLegs().getRightLine().rotate(ROTATE_LEFT);
			anOEFrame.refresh();
			ThreadSupport.sleep(QUICK_SLEEP); 
		}

		myScene.getGuard().scale(0.5);
		anOEFrame.refresh();

}


	public static void main(String[] args) { 
		Assignment1 myAssignment = new AnAssignment1(); 
		//myAssignment.animateLine();
		myAssignment.demonstrateBridgeScene();
		ThreadSupport.sleep(SHORT_SLEEP);

	}


}

