@StructurePattern(StructurePatternNames.LINE_PATTERN)
@PropertyNames({
	"X",
	"Y",
	"Height",
	"Width",             
})
@EditablePropertyNames({
	"X",
	"Y",
	"Angle",
	"Radius",
})
@Tags(Comp301Tags.ROTATING_LINE)
public class ALine implements Line {

	static final int 
	INITIAL_X = 100, 
	INITIAL_Y = 100;


protected int x = INITIAL_X, y = INITIAL_Y; 

PolarPoint p; 

public ALine(double radius, double angle) {
	p = new APolarPoint(radius, angle); 
}

public ALine() {
	p = new APolarPoint(); 
}


@Override
public int getX() {return x;} 
@Override
public void setX(int val) {x = val; }
@Override
public int getY() { return y; }
@Override
public void setY(int val) {y = val; }

@Override
public int getWidth() {return p.getX();}
